import React from 'react';

const Project = ({ title, description, link }) => {
  return (
    <div className="project">
      <h2>{title}</h2>
      <p>{description}</p>
      <a href={link} target="_blank" rel="noopener noreferrer">Voir le projet</a>
    </div>
  );
};

export default Project;
